import React from "react";
import "./Todo_screen.css";

function TodoList({ todos }) {
  return (
    <ul className="listtext">
      {todos.map((todo, index) => (
        <li key={index}>
          <button className="listbutton">{todo} </button>
        </li>
      ))}
    </ul>
  );
}

export default TodoList;
